xperience with Node.js, Express, Mongodb, MySQL.\",\n  \"Company\": \"Cognizant\",\n  \"Location\": \"Chennai\",\n  \"Required_skills\": [\n    \"Nodejs\",\n	\"MySQL\",\n    \"Expressjs\",\n    \"Mongodb\"\n  ],\n  \"Experience\": \"5 years\",\n  \"Salary\": \"5-10LPA\"\n}','Backend developer','2024-08-30'),(7,5,'{\"Description\": \"We are seeking a skilled Cloud Developer .Ideal candidates will have experience with Microsoft Azure,AWS,GCP.\",\n  \"Company\": \"Tech Mahindra\",\n  \"Location\": \"Pune\",\n  \"Required_skills\": [\n    \"AWS\",\n	\"Azure\",\n    \"GCP\",\n    \"Docker\",\n    \"Git\"\n  ],\n  \"Experience\": \"4 years\",\n  \"Salary\": \"6-10LPA\"\n}','Cloud developer','2024-08-30');
